import React, { Component } from 'react'
import video  from '../videos/seven.mp4' 

class seven extends Component {
    render() {
        return (
            <div>
                seven
                <div>
                <video width="750" height="500" controls >
                <source src={video} type="video/mp4"/>
                </video>
                </div>
            </div>
        )
    }
}
export default  seven ;
